import React from "react";
import "./InfoPanel.css"; // Import the CSS file

const InfoPanel = () => {
  return (
    <div className="info-panel-container">
      <h2>Personal Info</h2>
      <p>Here goes the personal information...</p>
    </div>
  );
};

export default InfoPanel;
